import React from "react";
import { View } from "react-native";

const AppCard = (props) => <View style={{
    borderWidth: 2,
    borderRadius: 4,
    padding: 10,
    margin: 4,
    // backgroundColor: "#f0f8ff",
    borderColor: "#f5f5dc",
  }}>{props.children}</View>;

export default AppCard;
